Моя Тройка - твоя история передвижений в регионах России. 
Скачайте приложение и все функции будут всегда под рукой: следите за балансом карты «Тройка» прямо в телефоне, стройте пешие и автомобильные маршруты, а еще отслеживайте пробки на дорогах. 

- Баланс вашей транспортной карты всегда доступен в приложении «Моя Тройка». В любой момент вы можете проверить остаток на счете;

- Планируйте поездки на личном авто. Мы расскажем, как лучше построить ваш маршрут, где нужно сделать пересадку, а еще покажем, что на дорогах пробки; 

- Хотите пройтись пешком? Построим быстрый и удобный маршрут, а также вы можете посмотреть, какие организации есть рядом; 

-Если у вас возникли вопросы, то наша поддержка работает 24/7 без выходных и перерывов на обед. На связи в чат-боте в приложении. 

